ь, искать и фильтровать списки мероприятий на передней панели вашего сайта.','Default page title (wizard)Events'=>'Мероприятия','If you plan on managing all listings from the admin dashboard you can skip creating this page.'=>'Если вы планируете управлять всеми списками из консоли администратора, вы можете пропустить создание этой страницы.','Default page title (wizard)Event Dashboard'=>'Консоль мероприятия','If you do not wish to accept submissions from users in this way (for example you just want to post events from the admin dashboard) you can skip creating this page.'=>'Если вы не хотите принимать заявки от пользователей таким образом (например, вы просто хотите публиковать события из панели администратора), вы можете пропустить создание этой страницы.','This page allows peoples to add events to your website from the front-end.'=>'Эта страница позволяет людям добавлять мероприятия на ваш сайт из внешнего интерфейса.','Default page title (wizard)Post an Event'=>'Опубликовать мероприятие','Content Shortcode'=>'Шорткод контента','Page Description'=>'Описание страницы','Page Title'=>'Заголовок страницы','Page Setup'=>'Настройка страницы','Continue to page setup'=>'Продолжить настройку страницы','Setup Wizard Introduction'=>'Введение в мастер установки','3. Done'=>'3. Готово','2. Page Setup'=>'2. Настройка страницы','1. Introduction'=>'1. Введение','WP Event Manager Setup'=>'Установка WP Event Manager','Setup'=>'Установка','Save Changes'=>'Сохранить изменения','Select a page&hellip;'=>'Выберите страницу&hellip;','--no page--'=>'--нет страницы--','Settings successfully saved'=>'Настройки успешно сохранены','Select the page where you have placed the [events] shortcode. This lets the plugin know where the event listings page is located.'=>'Выберите страницу, на которой вы разместили шорткод [events]. Это позволяет плагину узнать, где находится страница со списками мероприятий.','Event Listings Page'=>'Страница со списком мероприятий','Select the page where you have placed the [event_dashboard] shortcode. This lets the plugin know where the dashboard is located.'=>'Выберите страницу, на которой вы разместили шорткод [event_dashboard]. Это позволяет плагину узнать, где находится панель управления.','Event Dashboard Page'=>'Страница консоли мероприятия','Select the page where you have placed the [submit_event_form] shortcode. This lets the plugin know where the form is located.'=>'Выберите страницу, на которой вы разместили шорткод [submit_event_form]. Это позволяет плагину узнать, где находится форма.','Submit Event Form Page'=>'Страница отправки формы мероприятия','Pages'=>'Страницы','How many <strong>days</strong> listings are live before expiring. Can be left blank to never expire.'=>'Сколько <strong> дней </strong> листинги живут до истечения срока действия. Может оставаться пустым, чтобы никогда не истекать.','Listing Duration'=>'Продолжительность листинга','Listing expire on Specified Below Days'=>'Срок действия списка по указанным ниже дням','Listing expire on Event End Date'=>'Срок действия списка по дате окончания мероприятия','You can set event submission expiry time either event end date or specific days.'=>'Вы можете установить время истечения срока отправки мероприятия либо дату окончания мероприятия, либо конкретные дни.','Listing Expire'=>'Срок действия списка','If enabled, expired listings will automatically deleted after 30 days.'=>'Если включено, списки с истекшим сроком действия будут автоматически удаляться через 30 дней.','Expired listings are deleted after 30 days.'=>'Просроченные списки удаляются через 30 дней.','Delete Expired Listings'=>'Удалить просроченные листинги','If enabled, Multiple banner can add at frontend by user and backend side by admin.'=>'Если включено, то несколько баннеров могут быть добавлены на фронтенде пользователем и на бэкенде администратором.','User can submit multiple banner.'=>'Пользователь может отправить несколько баннеров.','Allow Multiple Banners'=>'Разрешить несколько баннеров','If enabled, submissions awaiting admin approval can be edited by the user.'=>'Если включено, oтправления, ожидающие одобрения администратора, могут быть отредактированы пользователем.','Submissions awaiting approval can be edited.'=>'Oтправления, ожидающие утверждения, могут быть отредактированы.','Allow Pending Edits'=>'Разрешить внесение изменений в ожидающие отправки','If enabled, new submissions will be inactive, pending admin approval.'=>'Если включено, новые oтправления будут неактивными, ожидая одобрения администратора.','New listing submissions require admin approval.'=>'Для отправки новых списков требуется одобрение администратора.','Moderate New Listings'=>'Модерация новых списков','If you enable user registration on your submission form, choose a role for the new user.'=>'Если вы разрешили регистрацию пользователей в форме отправки, выберите роль для нового пользователя.','Account Role'=>'Роль учетной записи','If enabled, an email will be sent to the user with their username and a link to set their password. Otherwise, a password field will be shown and their email address won\'t be verified.'=>'Если включено, электронное письмо будет отправлено пользователю с указанием имени пользователя и ссылки для установки пароля. В противном случае будет отображаться поле пароля, и их адрес электронной почты не будет проверен.','Use WordPress\' default behavior and email new users link to set a password.'=>'Используйте ссылку по умолчанию для WordPress и ссылку для новых пользователей электронной почты, чтобы установить пароль.','Account Password'=>'Пароль учетной записи','If enabled, a username will be generated from the first part of the user email address. Otherwise, a username field will be shown.'=>'Если включено, имя пользователя будет создано из первой части адреса электронной почты пользователя. В противном случае будет показано поле имени пользователя.','Automatically Generate Username from Email Address.'=>'Авто создание имени пользователя из адреса электронной почты.','Account Username'=>'Имя пользователя учетной записи','If enabled, non-logged in users will be able to create an account by entering their email address on the submission form.'=>'Если включено, пользователи без регистрации смогут создать учетную запись, указав свой адрес электронной почты в форме отправки.','Allow account creation.'=>'Разрешить создание учетной записи.','Account Creation'=>'Создание учетной записи','If disabled, non-logged in users will be able to submit listings without creating an account.'=>'Если этот параметр отключен, незарегистрированные пользователи смогут отправлять списки без создания учетной записи.','Submitting listings requires an account.'=>'Для отправки списков требуется учетная запись.','Account Required'=>'Требуется учетная запись','Event Submission'=>'Отправка мероприятия','Date Format'=>'Формат даты','Events will be shown if within ALL selected event types.'=>'Мероприятия будут показаны, если они относятся ко ВСЕМ выбранным типам мероприятий.','Events will be shown if within ANY selected event type.'=>'Мероприятия будут показаны, если они относятся к ЛЮБОМУ выбранному типу мероприятий.','Event Type Filter'=>'Фильтр типа мероприятия','Events will be shown if within ALL selected categories.'=>'Мероприятия будут показаны, если они относятся ко ВСЕМ выбранным категориям.','Events will be shown if within ANY selected category.'=>'Мероприятия будут показаны, если они относятся к ЛЮБОЙ выбранной категории.','If enabled, the event type select box will default to a multi select on the [events] shortcode.'=>'Если включено, поле выбора типа мероприятия будет по умолчанию иметь множественный выбор в шорткоде [events].','Enable event type multiselect by default.'=>'Включить множественный выбор типа мероприятия по умолчанию.','Multi-select Event Types'=>'Множественный выбор по типу мероприятия','If enabled, the category select box will default to a multi select on the [events] shortcode.'=>'Если включено, поле выбора категории по умолчанию будет иметь множественный выбор в шорткоде [events].','Enable event category multiselect by default.'=>'Включить множественный выбор категорий мероприятия по умолчанию.','Event Types'=>'Типы мероприятия','Categories'=>'Категории','If enabled, the content within expired listings will be hidden. Otherwise, expired listings will be displayed as normal (without the event registration area).'=>'Если включено, содержимое просроченных списков будет скрыто. В противном случае объявления с истекшим сроком действия будут отображаться в обычном режиме (без области регистрации на мероприятие).','Hide expired listing content in single event listing (singular).'=>'Скрыть просроченное содержимое списка в списке отдельного мероприятия (в единственном числе).','Hide Expired Listings Content'=>'Скрыть просроченное содержимое списков','If enabled, expired event listing is not searchable.'=>'Если включено, список просроченных мероприятий недоступен для поиска.','Hide expired listings in event archive/search.'=>'Скрыть просроченные списки в архиве/поиске мероприятия.','Hide Expired Listings'=>'Скрыть просроченные списки','If enabled, cancelled events will be hidden from archives.'=>'Если включено, отмененные мероприятия будут скрыты в архивах.','Hide cancelled events.'=>'Скрыть отмененные мероприятия.','Cancelled Events'=>'Отмененные мероприятия','How many listings should be shown per page by default?'=>'Сколько списков должно быть показано на странице по умолчанию?','Listings Per Page'=>'Списков на странице','Event Listings'=>'Списки мероприятий','General'=>'Общие','Delete'=>'Удалить','Edit'=>'Изменить','View'=>'Просмотр','Approve'=>'Одобрить','by %s'=>'от %s','Actions'=>'Действия','Event End Date'=>'Дата окончания мероприятия','Event Organizer'=>'Организатор Событий','Event Location'=>'Местоположение мероприятия','Event Category'=>'Категория мероприятия','Event Type'=>'Тип мероприятия','Featured?'=>'Рекомендуемый?','Cancelled?'=>'Отменено?','Status'=>'Статус','M j, Y @ 